import React from "react";
import {deleteFromDb} from './api/DeleteToDO';
import {useMutation,useQueryClient}  from '@tanstack/react-query';

function Note(props) {
  const queryClient = useQueryClient();
  function handleClick(item) {}
 
 const { mutate: Delete } = useMutation(
    (todo) => deleteFromDb(todo),
    {
      onSuccess: (data) => {
        queryClient.setQueryData(['todos',data],data)
        queryClient.invalidateQueries(['todos']);
      },
    }
  );
  

  return (
    <div className="note">
      {  props.note.map((item) => {
        return <ul> <li onClick={() => {handleClick(item)}} key={item._id}>{item.title}</li></ul>
      })}
      <button onClick={() => {Delete(props.id)}}>DELETE</button>
    </div>
  );
}


export default Note;
